export default function App() {
  return(
    <>
      <BrowserRouter>
        <div
          style={{
            display: "flex",
            background: "black",
            padding: "5px 0 5px 5px",
            fontSize: "20px",
        }}>

        </div>
      </BrowserRouter>
    </>
  )
}
